import{_ as r,B as e,c as n,o as c,j as a,G as l,a3 as T,a as J}from"./chunks/framework.6L905MQs.js";const j=JSON.parse('{"title":"自我剖析","description":"","frontmatter":{"title":"自我剖析","createAt":"2024-05-29T13:40:26.000Z","updateAt":"2025-02-10T21:07:29.000Z","tags":["生活","指南","心得"]},"headers":[],"relativePath":"📒文章/🤔反思和总结/📈个人成长/自我剖析.md","filePath":"📒文章/🤔反思和总结/📈个人成长/自我剖析.md","lastUpdated":1739368434000}'),d={name:"📒文章/🤔反思和总结/📈个人成长/自我剖析.md"};function p(M,t,U,_,g,m){const o=e("ArticleMetadata"),s=e("NolebaseGitContributors"),i=e("NolebaseGitChangelog");return c(),n("div",{"data-pagefind-body":!0,"data-pagefind-meta":"base64:"},[t[0]||(t[0]=a("h1",{id:"自我剖析",tabindex:"-1"},[J("自我剖析 "),a("a",{class:"header-anchor",href:"#自我剖析","aria-label":'Permalink to "自我剖析"'},"​")],-1)),l(o),t[1]||(t[1]=T('<div class="tip custom-block github-alert"><p class="custom-block-title">作者说：</p><p>我的MBTI是<a href="https://www.16personalities.com/ch/%E7%BB%93%E6%9E%9C/isfj-t/x/4meybbo7u" target="_blank" rel="noreferrer">ISFJ-T</a></p></div><div class="warning custom-block github-alert"><p class="custom-block-title">作者又说：</p><p>之前看到了一段话，感觉挺对：</p><p><strong>“</strong> isfj喜欢上一个人，基本都长期相处建立熟悉感，但是isfj并不能区分这种熟悉感是友情还是爱情。 所以往往别人主动推进时，isfj会后退，因为他不确定自己是不是喜欢你。如果isfj意识到他喜欢你，他会把你放到首位，对于你的对待会明显有别于其他朋友。问题就是如何让他认识到他喜欢你。也许，你在这段关系中短暂的后退能有帮助。如果他感觉不到揪心和失落，那只能是纯友情。 <strong>”</strong></p></div><h2 id="我是什么性格" tabindex="-1">我是什么性格？ <a class="header-anchor" href="#我是什么性格" aria-label="Permalink to &quot;我是什么性格？&quot;">​</a></h2><p>我懂我的性格了 为什么不适合谈恋爱就是：</p><ol><li>我并不爱事事都分享，对谁都一样，除非有件事特别值得分享；</li><li>我很能感同身受，但不会哄人，理性占据大脑，逻辑充斥思考；</li><li>我不爱说出自己的真实想法哪怕我很不舒服，因为我总希望让对方快乐（但我又没能力事事让对方快乐，我就一屌丝、乐子🤏）；</li><li>我是一个很轻易就能处好“朋友”关系的人，但并不适合从朋友上升。因为做朋友，双方都对对方没要求没期待，自由度很高（并不是说精神或身体自由，不知道谁能懂）；</li><li>我是一群人中的活宝角色，一个人时候的自由王子。表面落落大方，无敌自信，实则自卑敏感。就像«包氏父子»里的儿子，以为自己挺优秀的了，实则看见更强的打心底自卑，所以才越来越喜欢“<strong>见贤思齐</strong>”这四个字；</li><li>我希望有人关注我，但别一直来找我，偶尔来找我咱俩聊聊挺开心，这就可以了。没必要时时刻刻联系，恨不得黏在一起，受不了。</li><li>最后就是我并不在意别人看法，但我会很轻易地听到并记住别人无心说出的话，从而开始反省自己，内耗自己。</li></ol><p>当然上述并不能真的描述我，或许我在别人眼里更是不一样的。</p><p>总结我就是大反差，在别人眼里和在我自己眼里的“我”，是截然不同的。唠唠叨叨这么多我也不在意也不在乎谁能懂我。</p><p><strong>没关系，我即是我生活直播的榜一大哥。</strong></p><div class="tip custom-block"><p class="custom-block-title">RyanJoy 在<code>2025-02-10 11:46:23</code>回看心得</p><p>我仍然坚持上述文字的调调和立场，现在的我对自己的认识还是一样的，或许我真的就是这样的人吧，也或许我还会改变。一年之后再回来看看……</p></div>',9)),l(s),l(i)])}const I=r(d,[["render",p]]);export{j as __pageData,I as default};
